import React from 'react';
import CategorySidebar from '../categories/CategorySidebar';
import RecipeList from '../recipes/RecipeList';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';

const Main = () => {
    return (
        <Router>
            <div className="row">
                <div className="col-4">
                    <Switch>
                        <Route exact path='/dashboard' component={CategorySidebar} />
                    </Switch>
                </div>

                <div className="col-8">
                    <Route exact path='/dashboard' component={RecipeList} />
                    <Route exact path='/dashboard/addrecipe' component={AddRecipeForm} />
                </div>
            </div>
        </Router>
    )
}

export default Main;
